(5744, 'zhCN', '在祖尔格拉布击败伽布、莫尔塔克斯、伽乌里马、莫尔雷克、花翼巢穴女王、加兹兰卡的失落后裔、托尔图恩和古拉巴什厨师长（英雄难度）。', '古拉巴什猎头者', '', 56647),
