(607, 'zhCN', '生命火花：索德拉苏斯', '瓦德拉肯的赛克纳尔向你发出挑战，要你在PvP战斗中击败敌人。', '接受任务', '', '', 56647),
(606, 'zhCN', '生命火花：碧蓝林海', '瓦德拉肯的基伊努向你发出挑战，要你在PvP战斗中击败敌人。', '接受任务', '', '', 56647),
(605, 'zhCN', '生命火花：欧恩哈拉平原', '瓦德拉肯的艾里兹·石风向你发出挑战，要你在PvP战斗中击败敌人。', '接受任务', '', '', 56647),
