INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(268268, 'zhCN', '', '烈焰保佑，但我觉得不会。', 56647),
(259733, 'zhCN', '', '下一个就是你。', 56647),
(260378, 'zhCN', '', '谢谢，父亲。但愿这一天还很遥远。', 56647),
(260375, 'zhCN', '我也相信，等我不在的那一天，你会继续带着我难以企及的优雅和力量，登上王座，治理国家。', '', 56647),
(260374, 'zhCN', '可你已经不再需要我了。看到你变得如此坚强，我很欣慰。', '', 56647),
(260371, 'zhCN', '我原本只是想保护你，可我做得不够好。哪怕是现在，我们还是身处险境。', '', 56647),
(260345, 'zhCN', '', '我无法完全原谅你，却理解了你。', 56647),
(260336, 'zhCN', '', '但随着年龄增长，达格兰慢慢长大，我也慢慢成为领袖……', 56647),
(260333, 'zhCN', '', '真想再告诉你一次，你当年对我……和达格兰父亲做的事，我究竟是怎么想的。', 56647),
(260303, 'zhCN', '但哪怕是这样，你还是成为了一位头脑敏锐的领袖，用宽广的胸怀包容达格兰，让他按自己的心愿成长。', '', 56647),
(260294, 'zhCN', '不，是我活该。是我自己做了不光彩的事。', '', 56647),
(260287, 'zhCN', '', '什么？唔，真没想到你会说这种话。你身体出毛病了吗？', 56647),
(260283, 'zhCN', '我只想对你说……我……我为你骄傲。', '', 56647),
(260266, 'zhCN', '我明白。反正好过让我应付这些……机器。', '', 56647),
(260265, 'zhCN', '', '别担心，父亲。一切尽在掌控。', 56647),
(260264, 'zhCN', '茉艾拉，能和你谈谈吗？', '', 56647),
(263779, 'zhCN', '谢谢你，妈妈。我……真不知该说什么……我很期待能和你一起去探索发现。', '', 56647),
(263778, 'zhCN', '', '和你一起，就算随城市坠落、认识新朋友、跳下漆黑洞穴，我都情愿。', 56647),
(263777, 'zhCN', '', '你是我们族人的未来，还能为这个世界做出很多贡献——不要对自己有任何动摇。', 56647),
(263776, 'zhCN', '', '小时？要我听几天也行啊。虽然我总会对儿子偏心，不过你确实头脑聪慧。', 56647),
(263775, 'zhCN', '真的？有时候你问我问题……如果是我感兴趣的话题，我就能滔滔不绝讲上几个小时……', '', 56647),
(263774, 'zhCN', '', '你一向喜欢研究历史和文化。我已经把你当成一名非常优秀的顾问了。', 56647),
(263773, 'zhCN', '', '很好。我不希望你遇到危险，但你很适合冒险，真好。', 56647),
(263772, 'zhCN', '不，妈妈。我在这里学到了很多。这个世界很陌生……同时又很熟悉。', '', 56647),
(263771, 'zhCN', '', '达格兰，准备好下去了吗？不用勉强，你可以留在档案馆的。', 56647),
(260591, 'zhCN', '', '多恩诺嘉尔失去了守护者，我也失去了……一位挚友。', 56647),
(260588, 'zhCN', '', '哪怕我们中有一个不这么固执，也许就能避免他的悲剧。', 56647),
(260584, 'zhCN', '', '我丢下了他，还有多恩诺嘉尔，我以为他永远不会原谅我。但说到底……', 56647),
(260582, 'zhCN', '', '我的想法让我远离了泰坦，他却说我们现在更需要泰坦了。', 56647),
(260580, 'zhCN', '', '我见证了族人遭受的灾难。贝尔格里姆也一样。', 56647),
(260579, 'zhCN', '', '可是突然之间，一切都……分崩离析。心核隧途，档案馆……一件件事拼起来，开启了绝望的时代。', 56647),
(260578, 'zhCN', '', '我们两个对多恩诺嘉尔同样重要。', 56647),
(260576, 'zhCN', '', '但我们两个就像是一套辕上的两头羊，一起出力——他负责雷鸫，我有采石场和锻炉。', 56647),
(260573, 'zhCN', '', '每个人都会计算着自己取得的成就和荣誉，与别人比较。想着泰坦会更偏爱谁？', 56647),
(260566, 'zhCN', '', '我和贝尔格里姆是老对头。我们是同时当上护持的。', 56647),
(276521, 'zhCN', '打开任意地下堡终点的沉重之箱、丰裕宝匣或隐秘财宝就能获得进度，从而取得发现的奖励。\n\n地下堡越难，获得的进度就越多！', '', 56647),
(264632, 'zhCN', '', '哈哈！哈哈哈！', 56647),
(263040, 'zhCN', '这棵树是个奇迹！虽然有点憔悴，但只要螃蟹出现，树叶就开始恢复色彩。太奇怪了！\n\n如果我有更多的这种螃蟹，也许就能让它高兴起来。它们似乎很喜欢树！', '这棵树是个奇迹！虽然有点憔悴，但只要螃蟹出现，树叶就开始恢复色彩。太奇怪了！\n\n如果我有更多的这种螃蟹，也许就能让它高兴起来。它们似乎很喜欢树！', 56647),
(263507, 'zhCN', '侦测到未知异常，启动觉醒净除程序。', '', 56647),
(258213, 'zhCN', '快用传送门前往卡兹阿加，逃出去的人还需要你的帮助。', '', 56647),
(266134, 'zhCN', '明白了，布莱恩！你要我试着应战吗？', '', 56647),
(253394, 'zhCN', '我相信一切都在威尔汉公爵的掌控中。他是个出色的领袖！\n\n你知道的，正是凭借他的英明领导，他在威尔汉之陨折损的阿拉希人才相对较少。', '我相信一切都在威尔汉公爵的掌控中。他是个出色的领袖！\n\n你知道的，正是凭借他的英明领导，他在威尔汉之陨折损的阿拉希人才相对较少。', 56647),
(268948, 'zhCN', '', '<开心的笑>', 56647),
(268647, 'zhCN', '', '战争魔像已经激活，重新投入生产了。', 56647),
(265314, 'zhCN', '', '设施重启了！', 56647),
(265313, 'zhCN', '收工，伙计们！输了就应该认怂……', '', 56647),
(265081, 'zhCN', '', '如果她能控制扬升者……', 56647),
(265078, 'zhCN', '', '她一下就夺去了伊泰基的心智。', 56647),
(265077, 'zhCN', '', '快跑！快！', 56647),
(263478, 'zhCN', '', '已经完成了。', 56647),
(263476, 'zhCN', '', '你的扬升……', 56647),
(260586, 'zhCN', '', '趁现在！', 56647),
(260581, 'zhCN', '', '你猜？我们带了。', 56647),
(260577, 'zhCN', '看来你们真该带几个大点的朋友。', '', 56647),
(261892, 'zhCN', '', '我们要做的还有很多。', 56647),
(261891, 'zhCN', '接下来怎么办，鲁弗瑟拉？', '', 56647),
(261890, 'zhCN', '', '它们选择帮助我们，完全是出于自愿。', 56647),
(261889, 'zhCN', '', '不只是我的呼唤，还有它们自己。', 56647),
(261888, 'zhCN', '很好。雷鸫响应了你的呼唤。', '', 56647),
(261884, 'zhCN', '只需呼唤，它们就会应答。', '', 56647),
(261883, 'zhCN', '鲁弗瑟拉，雷鸫明白你的意图。集中精神。', '', 56647),
(261881, 'zhCN', '他违逆了泰坦，你也可以！', '', 56647),
(261880, 'zhCN', '贝尔格里姆是靠自己召唤雷鸫的。', '', 56647),
(261878, 'zhCN', '', '我做不到。泰坦……', 56647),
(263833, 'zhCN', '', '<用力的声音>', 56647),
(261968, 'zhCN', '无缚者！', '', 56647),
(261967, 'zhCN', '那么，作为多恩诺嘉尔议会护持，我宣布我们都是……', '', 56647),
(261966, 'zhCN', '谁愿承担这份殊荣？', '', 56647),
(261958, 'zhCN', '律令编成的地方。', '', 56647),
(261957, 'zhCN', '既然要废除，不如就从这里开始，就在这个……', '', 56647),
(261956, 'zhCN', '', '为此，我们必须废除律令——永远废除。', 56647),
(261955, 'zhCN', '', '是的。我们必须援助新盟友。', 56647),
(261954, 'zhCN', '大家一致同意吗？', '', 56647),
(252684, 'zhCN', '嗯？我认得你吗？\n\n不认得？好吧。我的记忆已经不复从前了。\n\n我是寇尔甘，哀念高地的照看者，这里是无缚者准备最终关机的一个地点。\n\n一些无缚者会在最后时刻来到这里，从而打破泰坦的循环，并以自己所选择成为的身份得到铭记。\n\n除非你的族类也和我们一样有静滞锁定的体验，否则我应该帮不到你。', '', 56647),
(261480, 'zhCN', '你看过这些新书吗，布莱恩？肯定是德伦登的馆藏。', '', 56647),
(259252, 'zhCN', '噢！你好，你是来和布莱恩聊天的吗？', '', 56647),
(251198, 'zhCN', '我就在你和布莱恩的身后。我已经准备好了解这里的一切了！', '', 56647),
(261676, 'zhCN', '', '向你致敬，英雄。我确实很期待目睹卡兹阿加，那里有许多等待探索的秘密！', 56647),
(275557, 'zhCN', '', '格瑞姆巴托对巨龙并不怎么友好，所以我一般不会去想那个地方。\n\n但如果你是想去那儿征服可怕的敌人，夺取他们的财宝，那我就等不及想听到你们凯旋的消息了。\n\n使用时间流的传送门前往暮光高地，然后往西就能在群山里找到入口。', 56647),
(275556, 'zhCN', '', '当然，你得先到了伯拉勒斯才行。入口就在汇帆市场底层的码头深处。\n\n但如果你是部落的话，就可以直接从劫掠港找到一个更安全的入口。\n\n先使用时间流的传送门前往提拉加德海峡，然后北上找到一个不会看到你就动手的城镇就是了。', 56647),
(275555, 'zhCN', '', '“潮”这个字很好玩，有时候是说新鲜时髦，有时候又是说品质低劣。\n\n<林多尔米停顿了一下，观察着你的反应。>\n\n反正呢，只要使用时间流的传送门前往晋升堡垒，然后往西南走就行。勇气神庙有一块地方还没完全变成废墟，入口就在那儿。', 56647),
(275554, 'zhCN', '', '在塞兹仙林很容易迷路，可能你在去的路上都会迷路！\n\n使用时间流的传送门前往炽蓝仙野，然后往西走，入口就隐藏在根系间，但藏得很深。', 56647),
(269791, 'zhCN', '“……双翼霹雳。”', '', 56647),
(269790, 'zhCN', '', '“……双翼霹雳。”', 56647),
(268067, 'zhCN', '你能相信吗，$n？想想埋藏在这里的所有历史吧！', '', 56647),
(266394, 'zhCN', '如果外来者能坚持战斗，那么我们也应如此。帝皇要求我们必须突破自身极限，超越我们的敌人。', '', 56647),
(266392, 'zhCN', '圣焰将赐予我们力量，兄弟。让异教徒激起蜃鱼人的怒火。我们就可以趁机打击他们毫无防备的侧翼。', '', 56647),
(266390, 'zhCN', '请原谅西贝斯坦，我的新朋友。没有你的帮助，我们不可能走到这一步。', '请原谅西贝斯坦，我的新朋友。没有你的帮助，我们不可能走到这一步。', 56647),
(266389, 'zhCN', '你在战斗中的自律令人印象深刻，兄弟。这个外来者应该好好学学。', '', 56647),
(261758, 'zhCN', '<安度因端详着你。>\n\n$n，和往常一样，你在这里也帮上了大忙。你是怎么做到的？\n\n发生暗影界的那些事之后，我……\n\n我一直在煎熬。', '', 56647),
(261247, 'zhCN', '<安度因端详着你。>\n\n$n，和往常一样，你在这里也帮上了大忙。你是怎么做到的？\n\n在我做出过那些事……对你做出那些事之后，你为什么还能这样看着我？\n\n我当时差点要了你的命啊。', '', 56647),
(260534, 'zhCN', '大概什么时候？', '', 56647),
(260468, 'zhCN', '多恩诺嘉尔存在多久了？', '', 56647),
(260045, 'zhCN', '你说什么？', '', 56647),
(259965, 'zhCN', '回去干活吧……不去也行。', '', 56647),
(258826, 'zhCN', '你好哇！对寻宝游戏感兴趣吗？那是当然啦。\n\n我有一份失物清单——我的意思是，在这个洞穴中的一堆乱七八糟的物品。谁能最先把它们全部找回来，谁就能赢得这笔宝藏。\n\n我甚至会额外赠送一颗能提高游泳速度，从而方便狩猎的水晶。真是太划算了！', '', 56647),
(258555, 'zhCN', '', '<沃克格雷抿了一口她的燧酿，然后抬头看向你。>\n\n找到你要的液态欧珀需要时间，我亲爱的小宝贝。\n\n所以，当我的眼线在市场上嗅探你需要的东西时，我希望你也能发挥你的聪明才智。', 56647),
(256097, 'zhCN', '', '你好！很高兴见到你！\n\n我叫萨雷莎，拉南的阿加远征队新兵。我很高兴能来这里。\n\n不过……你知道的。\n\n我对泰坦技术非常感兴趣，而拉南和图贝罗斯很擅长这个领域，拉南叫它那些“东西”。我真的很想近距离瞧瞧！\n\n看来我很有机会！虽然是靠整座城市的坠毁换来的……', 56647),
(266645, 'zhCN', '布莱恩？他一定和其他探险者到某个地方去了。\n\n勇士，我们应该出发了。我能听到艾泽拉斯的伤口在呼求援助。', '', 56647),
(266491, 'zhCN', '', '狗头人的好朋友，$n。谢谢你。', 56647),
(254492, 'zhCN', '怎么样啦，朋友？', '怎么样啦，朋友？', 56647),
(252740, 'zhCN', '在暗处给我盯紧了，苦工。扬升之日不得出错。', '在暗处给我盯紧了，苦工。扬升之日不得出错。', 56647),
(251935, 'zhCN', '我们得说快点儿，空气中毒素太多。\n\n拿上这双践踏之鞋，用它们来重新激活损坏的空气净化器。在死狗头人身上拿齿轮。找回所有齿轮，拯救水能堡。\n\n去吧。', '', 56647),
(261702, 'zhCN', '', '现在，我们要探索自己的真我。', 56647),
(261700, 'zhCN', '', '艾泽拉斯正在成长，我们得跟上她的步伐。', 56647),
(261701, 'zhCN', '', '我们必须接受号召，做出改变。', 56647),
(261699, 'zhCN', '', '僵滞的传统几乎让我们走上绝路。', 56647),
(261696, 'zhCN', '', '在麦格尼做出牺牲前，土灵都被与生俱来的使命所束缚。', 56647),
(252793, 'zhCN', 'The Weaver bids you welcome.', '纺丝者欢迎你。', 56647),
(252791, 'zhCN', 'Scurry on, little scarab!', '快点儿，小甲虫！', 56647),
(256695, 'zhCN', '', '你是在掩盖自己的叛心吗？我先宰了他们，再连你的首级一起献上。', 56647),
(256694, 'zhCN', '以安苏雷克女王之名，我会碾碎这群叛党。', '', 56647),
(256691, 'zhCN', '你们只会暴露自己的软弱。', '', 56647),
(256690, 'zhCN', '', '篡逆者来了！我要先干掉他们，再揭露我们当中的叛徒。', 56647),
(266867, 'zhCN', '如果你发现了什么，那就赶紧离开，我可不想被牵扯进来。', '如果你发现了什么，那就赶紧离开，我可不想被牵扯进来。', 56647),
(260896, 'zhCN', '', '穿刺暗影。', 56647),
(260892, 'zhCN', '', '粘性漩涡。', 56647),
(260891, 'zhCN', '', '粘滞爆炸。', 56647),
(260875, 'zhCN', '', '反抗只是徒劳。', 56647),
(260874, 'zhCN', '', '诱捕。', 56647),
(260838, 'zhCN', '虫群的盛宴。', '', 56647),
(260837, 'zhCN', '雷霆暴怒。', '', 56647),
(260836, 'zhCN', '疾冲猛袭。', '', 56647),
(260835, 'zhCN', '屠戮狂飙。', '', 56647),
(260834, 'zhCN', '势不可挡。', '', 56647),
(260822, 'zhCN', '', '你们的死期到了！', 56647),
(260821, 'zhCN', '你们的脑袋归我了！', '', 56647),
(261912, 'zhCN', '士兵们，去地面！', '', 56647),
(254365, 'zhCN', '', '只要达格兰有兴趣，那他就完全停不下来是吗？\n\n就像我说的，塔尔罗克是一处重要的矿井。它就像是一台动力满满的机器。我和工头寇尔·棕峭也是老相识了。但我们已经很久没说话了。\n\n我要搞清矿石生产停滞不前的原因……即便高阶代言人不愿让我找到答案。他可能已经派人去调查了，但我们还是应该自己去看看。', 56647),
(271002, 'zhCN', '最近AR-938区地表的土灵经历了许多艰难困苦。\n\n先是外乡人坠落在他们的海边，然后蛛魔又袭击了他们的要塞多恩诺嘉尔。外乡人和驭雷者成功驱逐了这些入侵者，但心核隧途也遭受了严重的损坏。\n\n在外乡人的帮助下，土灵的无缚者（之前是石缚者）与圣誓者（依然忠于泰坦）再次团结起来守卫地表，驱除蛛魔，并开始修复心核隧途。\n\n在这些事件中，驭雷者损失惨重，并且还失去了风暴护持贝尔格里姆。好在心核隧途通向冈达加兹和机语者的道路终于得以修复。\n\n但修复心核隧途的工作还在进行中。', '', 56647),
(270198, 'zhCN', '蜕躯工厂苦工感受到了你的信息素，并给你让出了一条宽阔的道路。', '', 56647),
(266936, 'zhCN', '', '你和图拉扬太像了：战场上英勇无畏，却羞于谈及心事。', 56647),
(265279, 'zhCN', '可是战局就快逆转了！', '', 56647),
(265155, 'zhCN', '', '我不需要你存活下去。', 56647),
(263196, 'zhCN', '', '从有记忆起，高阶代言人一直掌握着权力……但他再也不是我们的同胞了。', 56647),
(262604, 'zhCN', '', '启动震地协议。', 56647),
(262333, 'zhCN', '我们应该可以跳到那些小蘑菇上。', '', 56647),
(261918, 'zhCN', '', '入侵者？我们明明是从天上掉下来的，战斗是为了生存！', 56647),
(259785, 'zhCN', '现在还得搞定那玩意儿。看来蜃鱼人是用前头的诱饵把它引来的。', '', 56647),
(259762, 'zhCN', '', '向黑夜屈服吧。', 56647),
(256027, 'zhCN', '', '你根本没注意自己的治疗者！我怎么可能不想抓住这个机会呢？', 56647),
(256024, 'zhCN', '而我居然还在思考，怎么让步兵冲上前线又不让他送命！你居然让骑士无遮无掩，菲琳？太危险了。', '', 56647),
(255118, 'zhCN', '这座城市真美，阿拉希人短时间内在这里建起的城市真是不可思议。\n\n想想吧，这一切发生的时候，我们正在抗击燃烧军团，随后是第四次战争，再然后……\n\n嗯，真是壮观。', '', 56647),
(254822, 'zhCN', '好问题，$r。我是唤醒者——我的职责就是进入这些古老之地，或找到新苏醒过来的地方，然后确保一切都能井然有序。你可以把喧鸣深窟想作是沉睡的巨人。我要做的就是照顾好它！\n\n我需要专注地完成仪式，还请保护我，并尽可能多地吸收主机的新生能量！我们应该可以撑到最后，只要能量足够的话……', '', 56647),
(268527, 'zhCN', '你不是唯一有这种感觉的，祭司长。如今贝雷达尔的模样如此骇人，预示苦难和纷争即将来临。', '', 56647),
(267619, 'zhCN', '我会把找到的所有锁甲都留给你和克拉蕾，布鲁。', '', 56647),
(266121, 'zhCN', '<达格兰开始滔滔不绝地讲解起了狗头人的蜡、蜡的来源和去向。很明显，这些都是他在铁炉堡和卡兹阿加研究出来的知识，没什么真正的经验。>', '', 56647),
(265612, 'zhCN', '我听说了阿拉希的消息。身为国王……我是说，我很好奇。', '', 56647),
(265403, 'zhCN', '你到底想告诉我什么呢？', '', 56647),
(265214, 'zhCN', '好神奇……', '', 56647),
(264962, 'zhCN', '如果这是真的，我想去亲眼看看。也许，他们会是对抗萨拉塔斯的得力盟友。', '', 56647),
(264692, 'zhCN', '$n！我把一些燧烬蜂放出来了。', '', 56647),
(264131, 'zhCN', '每个人看起来都紧张不安，你不觉得吗？也不知道是为什么。\n\n噢，对了。是毁灭的可怕景象，还有达拉然传送到卡兹阿加的原因，我现在都想起来了。', '', 56647),
(264128, 'zhCN', '担心潜伏在卡兹阿加的危险？别怕，毕竟你有了不起的雷诺·杰克逊罩着你！', '', 56647),
(264108, 'zhCN', '不过，光是处置萨拉塔斯还无法挽救我们的人民。带我们走向衰落的正是安苏雷克。', '', 56647),
(262984, 'zhCN', '先驱曾向我低语过你的到来……', '', 56647),
(262611, 'zhCN', '', '所有系统……关闭……', 56647),
(261944, 'zhCN', '不行，这是我存在的理由。必须由你来指引土灵。', '', 56647),
(261934, 'zhCN', '我只听说过他们的英雄事迹……泰坦显灵了！', '', 56647),
(261921, 'zhCN', '你需要什么无关紧要。', '', 56647),
(261418, 'zhCN', '', '呃啊！我说……我们都完蛋了！', 56647),
(261128, 'zhCN', '', '高阶飞升者艾塔卡赫特，那位高耸虚居执法官，能够帮助我完成扬升。\n\n只要我能赢得他的青睐。\n\n<特克西特克所有的眼睛都微微眯起，显得有些烦躁。>\n\n……前提是我们得找到他。', 56647),
(260471, 'zhCN', '能给个大概的估计吗？', '', 56647),
(260469, 'zhCN', '', '未知。档案馆应该包含相关信息，但我说过，它当前无法使用。', 56647),
(260334, 'zhCN', '我看到了钥焰中的水晶。那不是艾泽里特，但很像，两者应该有什么联系。', '', 56647),
(260299, 'zhCN', '', '每个人都有这样的故事。记得有一次，我找到个洞穴——', 56647),
(260176, 'zhCN', '当然！可能你的记忆和我一样，几千年过去了，边角有点模糊了……', '', 56647),
(260092, 'zhCN', '', '先让你的赏金涨涨我再来收吧。再会了……小心背后。', 56647),
(260028, 'zhCN', '不断奋勇向前，一起迎接下一程的冒险。', '', 56647),
(260019, 'zhCN', '', '既然你已经……变了……感觉怎么样？', 56647),
(259046, 'zhCN', '不要在黑暗里乱走。', '不要在黑暗里乱走。', 56647),
(258553, 'zhCN', '<这个纺崽举起了纸条方便你查看。>\n\n一批失败的实验体正在幽暗要塞肆虐。在他们逃离之前消灭他们。\n\n附近藏着的信息素炸弹可以阻止他们。不过你需要先掩盖自己的气味。因此我给了你信息素。\n\n夺回装置并解决那些可怜的生物。\n\n——纺丝者', '', 56647),
(258479, 'zhCN', '对！快跑吧！', '对！快跑吧！', 56647),
(258194, 'zhCN', '全体返回岗位！快！', '', 56647),
(258037, 'zhCN', '别误会了。我们不能耽搁片刻，必须立刻赶往卡兹阿加。但我依然精疲力尽。\n\n艾泽拉斯的冲击力实在是难以抵挡。', '', 56647),
(258035, 'zhCN', '看来我们的命运就在卡兹阿加。那里会有什么？除了硝烟和战火？', '', 56647),
(258010, 'zhCN', '外公经历过更糟糕的情况，可他都挺过来了，他一定很快就能苏醒。\n\n他一定要苏醒啊……', '', 56647),
(258006, 'zhCN', '我认为这个后果不能归咎于艾泽拉斯。麦格尼知道，不情不愿地联系她会产生很大的风险。\n\n现在，我们只能希望他最后听见了她的消息。', '', 56647),
(257697, 'zhCN', '真的能够传送吗？！总算有突破了！', '真的能够传送吗？！总算有突破了！', 56647),
(257511, 'zhCN', '', '欧尔巴里格，你在哪儿？我们需要你……', 56647),
(255510, 'zhCN', '', '我们不知道下面的情况！援军就要到了，我们可以先等等……', 56647),
(254629, 'zhCN', '', '这道……暗影……太强了……！', 56647),
(253162, 'zhCN', '不能再邀请别人了。', '', 56647),
(253151, 'zhCN', '恶魔之怒不足。', '', 56647),
(252126, 'zhCN', '外公总算是没事了。我们聚在一起的时候不多，我就担心他……\n\n不过现在都没事了！他好像已经痊愈了。', '', 56647),
(268542, 'zhCN', '', '记忆宝石已经找到了。但我们必须继续前进，肃清这片区域当前的蛛魔威胁。不过，这里的蛛网实在是太多了……\n\n我会改进这个设备，让它能够摧毁蛛网。用它来开辟一条前进的道路。', 56647),
(268257, 'zhCN', '还不是因为坦普动作太慢了。', '', 56647),
(268256, 'zhCN', '他们能弄脏你的长袍，那是因为因为在坦克准备好之前你就开始拉怪了。', '', 56647),
(268043, 'zhCN', '', '妹妹？你没事吧？', 56647),
(267317, 'zhCN', '', '<塔拉之前的羞涩已经消失，她现在正兴奋地挥舞着一把勺子，仿佛挥舞着一把剑。>\n\n等我长大了，我要做一个土灵！妈妈说他们都是岩石做的，肚子里有宝石。\n\n我以前试过吃宝石，但那真的很难下咽。我决定慢慢来，把宝石压碎，这样就容易吞下去了！', 56647),
(265656, 'zhCN', '', '这是......一名骑士在远征前请求我给她的。', 56647),
(265652, 'zhCN', '这幅画描绘的是焰爪之歌。那是一只赫赫有名的作战山猫，它曾经冲进燃烧的飞艇里，救出了自己的骑手。', '', 56647),
(265609, 'zhCN', '', '很高兴见到你，勇士。它从洞里钻出来之后，我就一直跟着它。', 56647),
(265317, 'zhCN', '哇？她说我棒极了？这样的夸奖能给我上紧发条，你懂我的意思。', '', 56647),
(264561, 'zhCN', '', '那个怪物逃回了女王身边，关于你的强悍和英勇的消息也会随之传去。', 56647),
(264549, 'zhCN', '', '幸好我的女儿和外孙都平安无事。你削弱了他们的指挥官，还净化了我的家。谢谢你。', 56647),
(262945, 'zhCN', '我们跨越了风暴肆虐的大海，从未见过如此强劲的风，如此滔天的浪！我有好几次都觉得船要葬送在风暴中了！', '我们跨越了风暴肆虐的大海，从未见过如此强劲的风，如此滔天的浪！我有好几次都觉得船要葬送在风暴中了！', 56647),
(262812, 'zhCN', '快进去！', '快进去！', 56647),
(262440, 'zhCN', '趁现在，一窝蜂上吧！', '', 56647),
(262197, 'zhCN', '虽然算不上是绝世美味，但只要抓上几只塞进罐子里，就能当成不错的光源使用了。\n\n又一次我在林子里回收资源，罐子发出的光芒引来了一只大火虫！它像宠物一样跟我走了很远。这种生物很温顺，它们只想飞来飞去，抛洒那斑斓的光辉。', '', 56647),
(261385, 'zhCN', '这个土灵人偶定格在绝望的状态中，其工艺细节之精湛堪比你在上层所见的真实土灵。\n\n这件作品的石质纹理和真实土灵完全一模一样。', '这个土灵人偶定格在绝望的状态中，其工艺细节之精湛堪比你在上层所见的真实土灵。\n\n这件作品的石质纹理和真实土灵完全一模一样。', 56647),
(261292, 'zhCN', '别傻愣在那儿！', '', 56647),
(260817, 'zhCN', '欢迎，$r。\n\n很久以前，议会护持麦里克斯任命为我多恩诺嘉尔的装潢师。\n\n我的庄严职责是维护这座城市，让其造型设计能够和谐如一。每过一个周期，我都会勤勤恳恳在多恩诺嘉尔的街头巷尾注入时尚和美学设计，让优雅和效能无形地融入其中，与我们的尊贵传承显得相得益彰。\n\n作为护持委任的装潢师，我致力于维护麦里克斯的传承，确保多恩诺嘉尔在未来的周期中仍是一处美丽与奇观的道标。\n\n需要我为你做什么吗？', '', 56647),
(259422, 'zhCN', '', '谢谢你！拿上这些靴子，让蜃鱼人知道，当他们袭击我们的村庄时，我们不会坐视不理。', 56647),
(259414, 'zhCN', '', '这群蜃鱼人洗劫了一个村庄并偷走了他们的圣物，于是我追逐他们进入了无底沉穴。\n\n遗憾的是，我只是个发明家，不是战士。到目前为止，只凭肾上腺素撑着。不过，我确实有个发明能帮到你。\n\n你可以使用我的圣光之靴。它的魔法会将你高高射向空中，这样你就可以重重砸向毫无戒备的敌人。它们应该能帮你打败下面的蜃鱼人。', 56647),
(257935, 'zhCN', '', '蛛魔正在利用斯卡丁抓捕机语者。\n\n计划：你来拿上这个设备，它会把斯卡丁引诱到另一个地方。用它来拯救其他机语者。\n\n这个计划是……实验性的，不适合我。我会留在这里。', 56647),
(256314, 'zhCN', '', '帝国山猫生性顽固。除了我之外，火花不愿意让任何人跨上它。在它脾气暴躁的时候，我也许只能徒步走完最后的路，将物品递送出去。\n\n但只要它肯动起来，能比火花还快的就只剩下飞艇了。在这条道上，我只愿意让它帮我盯紧后背。', 56647),
(255997, 'zhCN', '这么说来，前去探访一定会非常有趣。', '', 56647),
(255898, 'zhCN', '<基艾拉面带笑容，一边烹饪一边哼着小曲。锅子里传出了洋葱和蒜瓣的气味。>', '<基艾拉面带笑容，一边烹饪一边哼着小曲。锅子里传出了洋葱和蒜瓣的气味。>', 56647),
(253535, 'zhCN', '', '灰烬啊，她已经走了。看来救我们的人不喜欢蛛魔。去找她吧，我会把其他人带到安全的地方。', 56647),
(248952, 'zhCN', '看样子我们得活动一下腿脚了！', '', 56647);
