(4, 'zhCN', '潜行者', '潜行者', '潜行者', '潜行者在团队中经常充当刺客或侦察兵的角色，但也有许多潜行者乐于做个独行侠。潜行者总能神不知鬼不觉地游走在敌人身旁，从身后对敌人发动突袭，迅速夺取敌人的生命。', '角色：|cffffffff近战伤害输出|r', '要选择该职业，你必须更换一个种族。', '潜行者', '潜行者', 56647);
