(85, 'zhCN', '土灵', '土灵', '土灵', '土灵', '土灵', '', '土灵', '', '新生的土灵已经不再被律令所约束，他们怀着无尽的好奇心探索着这个世界，并加入了联盟。', '土灵', '', '土灵', '', 56647),
(84, 'zhCN', '土灵', '土灵', '土灵', '土灵', '土灵', '', '土灵', '', '新生的土灵已经不再被律令所约束，他们怀着无尽的好奇心探索着这个世界，并加入了部落。', '土灵', '', '土灵', '', 56647),
(36, 'zhCN', '玛格汉兽人', '玛格汉兽人', '兽人', '兽人', '玛格汉兽人', '', '玛格汉兽人', '', '德拉诺星球未被腐化的兽人氏族抛弃了过去的争端，团结一心，组成了勇猛的玛格汉氏族。', '兽人', '', '兽人', '', 56647);
