(2596, 'zhCN', '斩离之丝（典范）', '并非所有人都对安苏雷克女王的残酷统治忍气吞声。斩离之丝正在幕后秘密地谋划，打算从内部瓦解安苏雷克织造的铁律。', 56647),
(2606, 'zhCN', '高耸虚居', '控制千丝之城的高耸虚居的生物行为。', 56647),
(2649, 'zhCN', '将军（典范）', '阿努巴扎尔曾经是艾基-卡赫特声威显赫的军事领袖，安苏雷克却将其冷落，只宠幸自己的扬升者。这等轻慢岂能容忍？', 56647),
(2648, 'zhCN', '纺丝者（典范）', '曾经的皇家纺织者寡妇阿拉克奈，如今正以敏锐的目光监视着自己过去的家园。她编织了一张由纺崽和间谍组成的网络，鲜有动静能够逃过她的目光。', 56647),
(2647, 'zhCN', '宰相（典范）', '深入狼穴的执行官尼兹雷克随侍在安苏雷克女王左右，担任她最忠心耿耿的顾问。幸好安苏雷克尚未发现，在剩下的时间里，尼兹雷克都在为了终结她的统治而奔走。', 56647),
(2607, 'zhCN', '宰相', '深入狼穴的执行官尼兹雷克随侍在安苏雷克女王左右，担任她最忠心耿耿的顾问。幸好安苏雷克尚未发现，在剩下的时间里，尼兹雷克都在为了终结她的统治而奔走。', 56647),
(2605, 'zhCN', '将军', '阿努巴扎尔曾经是艾基-卡赫特声威显赫的军事领袖，安苏雷克却将其冷落，只宠幸自己的扬升者。这等轻慢岂能容忍？', 56647),
(2601, 'zhCN', '纺丝者', '曾经的皇家纺织者寡妇阿拉克奈，如今正以敏锐的目光监视着自己过去的家园。她编织了一张由纺崽和间谍组成的网络，鲜有动静能够逃过她的目光。', 56647);
