(224055, 'zhCN', '这本书是关于蛛魔的采矿技巧，目标读者群是刚开始学采矿的新手。对矿工来说很有用。', '', '', '', '《坚石起步》', 56647),
(224054, 'zhCN', '刚印出来的小册子，里面从理论角度推测了在蛛魔宝石制作过程中共鸣水晶的用途。对珠宝匠很有用。', '', '', '', '《地表居民的新兴水晶》', 56647),
(224053, 'zhCN', '副标题是《安卡赫特失陷的教训》。这本大部头考察了扰乱和偏转巫妖王及其仆从的符文之力的可能方法。对铭文师也许有用。', '', '', '', '《防御敌对符文八法》', 56647),
(224052, 'zhCN', '这本书深入浅出地向蛛魔儿童介绍工程学概念。但对工程师来说可能也会有用。', '', '', '', '《时钟、齿轮、链轮和长腿》', 56647),
(224050, 'zhCN', '一个促销包装袋，上面介绍了为自己的蛛网附魔这种价值主张。对附魔师来说可能有用。', '', '', '', '丝网火花：英姿动人', 56647),
(224038, 'zhCN', '小小的册子，非常破旧，教导蛛魔匠人如何在使用萨隆邪铁之后适应更平凡的材料来进行工作。对铁匠来说也许有用。', '', '', '', '《后萨隆邪铁时代的熔炼》', 56647),
(224036, 'zhCN', '这本书记载了蛛魔剧场中织网的悠久历史。对裁缝来说也许可以从中获得启发。', '', '', '', '《谢幕丝网！》', 56647),
(224024, 'zhCN', '抽象的理论，讲述了用炼金术永久转化某人的身体带来的副作用。对炼金师来说也许有用。', '', '', '', '《身体转化论》第8章', 56647),
(224023, 'zhCN', '一本小册子，介绍了如何使用卡兹阿加和诺森德的稀有草药来完美地储藏遗骸从而保留其风味。对草药师来说也许有用。', '', '', '', '《草药防腐工艺》', 56647),
(224007, 'zhCN', '还挺详细的说明，介绍了如何使用蜘蛛吞噬了猎物后残留的东西。对剥皮匠来说还算有点用，但大家都觉得很恶心。', '', '', '', '《残留躯壳用途（如何拆分）》', 56647),
(228429, 'zhCN', '你看到了自己。', '', '', '', '反射的石头', 56647),
