INSERT INTO `journal_encounter_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2581, 'zhCN', '阿努布伊卡基', '阿努布伊卡基是安苏雷克女王最杰出的战术家之一。他善于创造性地利用本地资源，因计划周密而闻名遐迩。他的士兵们对他有着狂热的忠诚。', 56647),
(2654, 'zhCN', '“屠夫”血钩', '“屠夫”血钩的残忍之名响彻库尔提拉斯。在铁潮突袭队的支持下，“屠夫”在整个伯拉勒斯横行，沿途留下一片狼藉。', 56647),
(2590, 'zhCN', '机械大师', '机械大师只喜欢在高端的工地处理复杂的工作。布洛克和多利塔一直是队友，合作的时间长到都没人记得了。布洛克的工作效率确实是在下降，但这两位都有权通过直接而高效的暴力来捍卫自己的工地。', 56647),
(2582, 'zhCN', '虚空代言人艾里克', '艾里克已被罢黜，权威尽失！他不堪失败，逃到了矶石宝库最深处的密室里。然而机关算尽的他最终屈服于异变：一件故障的神器渗出了虚空能量，并腐化了他的岩石之躯！如今，神秘的启示已经击碎了他的理智。', 56647),
(2579, 'zhCN', '斯卡莫拉克', '在无数个年月中，高阶代言人一直试图修复觉醒主机。而一次失败孕育出了新的恐魔：一个注入了斯卡丁腐蚀的魔像。水晶增强了它的元素构造。虽然无法传达出格格不入的思维，但它对万千生灵的憎恨溢于言表。', 56647),
(2572, 'zhCN', 'E.D.N.A.', '启动防御协议！土灵防御与灭除自动体已激活。非正式名称：E.D.N.A。此魔像会对任何潜在的入侵者采取不可预见的紧急措施。虽然它的主要指令是灭除斯卡丁，但任何未经授权的入侵者都会引发它作出致命应对。', 56647),
(2593, 'zhCN', '拉夏南', '拉夏南是来自艾基-卡赫特深处的飞翼恐兽。如果安苏雷克女王的军队未能征服米雷达尔，拉夏南将成为女王摧毁阿拉希的秘密武器。', 56647);
