(28901, 'zhCN', '治疗者', '$bullet;多波 |cFF2959D3|Hspell:439789|h[酸液翻腾]|h|r会向指定方向移动，并将 |cFF2959D3|Hspell:439780|h[粘性蛛网]|h|r腐蚀为|cFF2959D3|Hspell:439776|h[酸液池]|h|r。\n$[14,17$bullet;|cFF2959D3|Hspell:434089|h[喷射丝线]|h|r断裂时对整个小队造成伤害。$]\n$[15$bullet;|cFF2959D3|Hspell:434089|h[喷射丝线]|h|r会影响目标玩家附近的所有其他玩家，并在断裂时对整个小队造成伤害。$]\n$[16$bullet;|cFF2959D3|Hspell:434089|h[喷射丝线]|h|r断裂时会形成 |cFF2959D3|Hspell:460789|h[粘稠蛛丝]|h|r 。$]\n$[14,17$bullet;|cFF2959D3|Hspell:455287|h[被感染的子嗣]|h|r的|cFF2959D3|Hspell:439815|h[感染撕咬]|h|r会造成大量伤害。$]\n$[15,16$bullet;|cFF2959D3|Hspell:439815|h[被感染的子嗣]|h|r会在命中的目标玩家附近造成大量伤害。$]', 56647),
(28181, 'zhCN', '伤害输出者', '$bullet;|cFF2959D3|Hspell:426860|h[暗黑法球]|h|r飞行的距离越远，最终爆炸时造成的伤害越低。\n$bullet;|cFF2959D3|Hspell:427001|h[恐惧猛击]|h|r会造成高额伤害，并使主要目标周围的其他玩家陷入恐惧。', 56647),
(28179, 'zhCN', '治疗者', '$bullet;|cFF2959D3|Hspell:426860|h[暗黑法球]|h|r飞行的距离越远，最终爆炸时造成的伤害越低。\n$bullet;|cFF2959D3|Hspell:426787|h[晦影腐朽]|h|r会对所有玩家造成高额伤害。', 56647),
(28429, 'zhCN', '坦克', '$bullet;|cFF2959D3|Hspell:440134|h[蜂蜜料汁]|h|r在效果结束时从目标玩家身上滴落，形成烈焰蜂蜜池，造成火焰伤害。\n$bullet;|cFF2959D3|Hspell:438025|h[点心时间]|h|r留在竞技场内的桶会周期性地吸引贪婪的燧烬蜂。', 56647),
(28711, 'zhCN', '治疗者', '$bullet;|cFF2959D3|Hspell:458272|h[宇宙幻影]|h|r激活时会对所有玩家造成轻微伤害。\n\n$bullet;|cFF2959D3|Hspell:458272|h[宇宙幻影]|h|r被摧毁时会对所有玩家施加|cFF2959D3|Hspell:459273|h[宇宙碎片]|h|r。\n\n$bullet; |cFF2959D3|Hspell:433475|h[相位之刃]|h|r会对击中的玩家造成严重的持续伤害，并降低受到的治疗效果。', 56647),
(30381, 'zhCN', '伤害输出者', '$bullet;若虔诚的敬奉者未被击败，则会施放|cFF2959D3|Hspell:448458|h[寰宇天启]|h|r。\n$bullet;幽暗幼体触及安苏雷克时会造成致命伤害。\n$bullet;|cFF2959D3|Hspell:445422|h[吐沫的饕餮者]|h|r吸收|cFF2959D3|Hspell:445152|h[侍僧精华]|h|r时会产生|cFF2959D3|Hspell:445877|h[泛沫蒸汽]|h|r。\n$bullet;|cFF2959D3|Hspell:441556|h[剧毒新星]|h|r引爆|cFF2959D3|Hspell:437417|h[活性飞沫]|h|r时会产生|cFF2959D3|Hspell:438846|h[反应蒸汽]|h|r。', 56647),
(30002, 'zhCN', '伤害输出者', '$bullet;若虔诚的敬奉者未被击败，则会施放|cFF2959D3|Hspell:448458|h[寰宇天启]|h|r。\n$bullet;幽暗幼体触及安苏雷克时会造成致命伤害。\n$bullet;|cFF2959D3|Hspell:445422|h[吐沫的饕餮者]|h|r吸收|cFF2959D3|Hspell:444829|h[女王的应诏者]|h|r时会产生|cFF2959D3|Hspell:445877|h[泛沫蒸汽]|h|r。\n$bullet;|cFF2959D3|Hspell:441556|h[剧毒新星]|h|r引爆|cFF2959D3|Hspell:437417|h[活性飞沫]|h|r时会产生|cFF2959D3|Hspell:438846|h[反应蒸汽]|h|r。', 56647),
