(29546, 'zhCN', '达加·燃影者', '达加·燃影者会单独与玩家战斗，直到快要被玩家击败。随后他会召唤瓦里昂娜加入战斗，并继续在瓦里昂娜的背上与玩家战斗。', 56647),
(28981, 'zhCN', '治疗者', '$bullet;|cFF2959D3|Hspell:442526|h[试验性剂量]|h|r会使附近的卵孵化，释放出其中孕育的恐怖实验品。\n$bullet; 随着虫巢扭曲者欧维纳克斯获得更多|cFF2959D3|Hspell:450362|h[不稳定的灌能]|h|r，造成的暗影伤害和治疗吸收会随之提高。\n$bullet;|cFF2959D3|Hspell:441362|h[不稳定的混合物]|h|r被移除时会基于目标损失的生命值对所有玩家造成伤害。', 56647),
