(28979, 'zhCN', '坦克', '$bullet;|cFF2959D3|Hspell:441362|h[不稳定的混合物]|h|r被移除时会基于目标损失的生命值对所有玩家造成伤害。\n$bullet;|cFF2959D3|Hspell:442802|h[腥红溢流]|h|r会使接触的任何生物发生异变。\n$bullet;巨型蜘蛛会使用|cFF2959D3|Hspell:438807|h[恶毒之咬]|h|r造成不断提高的伤害。', 56647),
(28970, 'zhCN', '伤害输出者', '$bullet;|cFF2959D3|Hspell:444363|h[阴森呕吐]|h|r会使血缚恐魔面前的玩家进入|cFF2959D3|Hspell:462306|h[无明界]|h|r。\n$bullet;被遗忘的末日使者会施放|cFF2959D3|Hspell:445174|h[具现恐怖]|h|r直到被击败。\n$bullet;|cFF2959D3|Hspell:443042|h[异世之握]|h|r会在随机玩家的脚下生成。', 56647),
(28903, 'zhCN', '伤害输出者', '$bullet;多波|cFF2959D3|Hspell:439789|h[酸液翻腾]|h|r会向指定方向移动，并将 |cFF2959D3|Hspell:439780|h[粘性蛛网]|h|r腐蚀为|cFF2959D3|Hspell:439776|h[酸液池]|h|r。\n$[14,17$bullet;|cFF2959D3|Hspell:434089|h[喷射丝线]|h|r断裂时对整个小队造成伤害。$]\n$[15$bullet;|cFF2959D3|Hspell:434089|h[喷射丝线]|h|r会影响目标玩家附近的所有其他玩家，并在断裂时对整个小队造成伤害。$]\n$[16$bullet;|cFF2959D3|Hspell:434089|h[喷射丝线]|h|r断裂时会形成 |cFF2959D3|Hspell:460789|h[粘稠蛛丝]|h|r 。$]\n$bullet;|cFF2959D3|Hspell:439815|h[被感染的子嗣]|h|r的目标玩家会产生新的狂暴敌人，不断施放|cFF2959D3|Hspell:455287|h[感染撕咬]|h|r。', 56647),
(28902, 'zhCN', '坦克', '$bullet;多波|cFF2959D3|Hspell:439789|h[酸液翻腾]|h|r会向指定方向移动，并将 |cFF2959D3|Hspell:439780|h[粘性蛛网]|h|r腐蚀为|cFF2959D3|Hspell:439776|h[酸液池]|h|r。\n$bullet;|cFF2959D3|Hspell:439815|h[被感染的子嗣]|h|r在对原始目标施放|cFF2959D3|Hspell:455287|h[感染撕咬]|h|r后会四处游荡。\n$bullet;|cFF2959D3|Hspell:444687|h[野蛮突袭]|h|r未被减免的伤害会叠加|cFF2959D3|Hspell:458067|h[野蛮创伤]|h|r。', 56647),
(28893, 'zhCN', '综述', '流丝之庭的权臣为了博取女王的恩宠而相互倾轧，分别使用|cFF2959D3|Hspell:439992|h[缠网炸弹]|h|r和|cFF2959D3|Hspell:440158|h[鲁莽冲锋]|h|r袭击玩家。\n\n虚空能量达到100点时，塔卡兹基扬升并进入虚空形态，开始引发|cFF2959D3|Hspell:450980|h[存在瓦解]|h|r。\n\n重新加入战斗后，阿努巴拉什开始召唤|cFF2959D3|Hspell:438677|h[针刺虫群]|h|r，而塔卡兹基会祈唤|cFF2959D3|Hspell:438355|h[灾变熵能]|h|r。\n\n怒气达到100点时，阿努巴拉什陷入狂热之怒，并释放一阵|cFF2959D3|Hspell:451277|h[尖刺风暴]|h|r。\n\n两名庭臣得以使出全力，阿努巴拉什将凭借|cFF2959D3|Hspell:440158|h[鲁莽冲锋]|h|r在场地中横冲直撞，而塔卡兹基会继续施放灾变熵能', 56647),
(28833, 'zhCN', '综述', '乌格拉克斯试图通过|cFF2959D3|Hspell:434799|h[噬肉角力]|h|r吞噬玩家，在战斗场地上放置了很多团|cFF2959D3|Hspell:439502|h[追踪者缠网]|h|r。\n\n能量值为零时，乌格拉克斯因饥饿而疯狂，用|cFF2959D3|Hspell:436217|h[主宰冲锋]|h|r攻击玩家。然后乌格拉克斯要求获得食物，释放出|cFF2959D3|Hspell:458074|h[饥饿之嚎]|h|r，直到能量值回满。', 56647),
(28797, 'zhCN', '扭曲虚空幻影', '凯威扎的幻灵影响会模仿她的部分攻击。', 56647),
(28468, 'zhCN', '第9部分', '$[!8,23\n\n在史诗难度下，废料块中会爆发出熔岩波。$]', 56647),
(28438, 'zhCN', '治疗者', '$bullet;|cFF2959D3|Hspell:435622|h[遮天蔽日！]|h|r引爆所有剩余的燧酿炸弹，并对所有玩家造成高额物理伤害。\n$bullet;|cFF2959D3|Hspell:435789|h[燧火创伤]|h|r，在短时间内对所有玩家造成高额火焰伤害，每次燧酿炸弹被引爆都会触发。\n$bullet;|cFF2959D3|Hspell:436640|h[燃焰弹射]|h|r对受到影响的玩家造成大量持续性火焰伤害。', 56647),
(28437, 'zhCN', '伤害输出者', '$bullet;|cFF2959D3|Hspell:435622|h[遮天蔽日！]|h|r引爆所有剩余的燧酿炸弹。\n$bullet;|cFF2959D3|Hspell:435789|h[燧火创伤]|h|r，在短时间内对所有玩家造成高额火焰伤害，每次燧酿炸弹被引爆都会触发。\n$bullet;|cFF2959D3|Hspell:436640|h[燃焰弹射]|h|r会弹向附近的玩家和燧酿炸弹。', 56647),
(28401, 'zhCN', '坦克', '$bullet;阿努布泽克特向前方使用|cFF2959D3|Hspell:433425|h[穿刺]|h|r，对被击中的玩家造成大量伤害并将其击退。\n$bullet; |cFF2959D3|Hspell:433766|h[虫群之眼]|h|r会包围场地，限制玩家移动。', 56647),
(28180, 'zhCN', '坦克', '$bullet;|cFF2959D3|Hspell:426860|h[暗黑法球]|h|r飞行的距离越远，最终爆炸时造成的伤害越低。\n$bullet;|cFF2959D3|Hspell:427001|h[恐惧猛击]|h|r会造成高额伤害与击退，并使主要目标周围的其他玩家陷入恐惧。', 56647),
(28132, 'zhCN', '综述', '代言人夏多克朗对于玄夜会未能控制破晨号感到愤怒，携强大的暗影魔法来势汹汹。\n\n在生命值降低至50%和1%时，夏多克朗施放|cFF2959D3|Hspell:451026|h[黑暗降临]|h|r试图消灭留在破晨号上的玩家。', 56647),
(28097, 'zhCN', '治疗者', '$bullet;|cFF2959D3|Hspell:423557|h[不稳定的碎片]|h|r能提高治疗量和对|cFF2959D3|Hspell:423228|h[加固壳壁]|h|r造成的伤害，但也会对玩家造成暗影伤害。\n\n$bullet;|cFF2959D3|Hspell:423324|h[虚空释能]|h|r会造成暗影伤害，直到加固壳壁被击破。', 56647),
