(27931, 'zhCN', '伤害输出者', '$bullet;|cFF2959D3|Hspell:423588|h[圣光屏障]|h|r存在时，隐修院长穆普雷会造成不断提高的神圣伤害。\n$bullet;阿拉希虔信者受到|cFF2959D3|Hspell:425022|h[非凡力量]|h|r影响时会对附近的玩家造成神圣伤害。', 56647),
(27930, 'zhCN', '坦克', '$bullet;隐修院长穆普雷受到|cFF2959D3|Hspell:423539|h[心灵之火]|h|r影响时会造成更高的神圣伤害。\n$bullet;阿拉希虔信者受到|cFF2959D3|Hspell:425022|h[非凡力量]|h|r影响时会对附近的玩家造成神圣伤害。', 56647),
(27929, 'zhCN', '治疗者', '$bullet;隐修院长穆普雷受到|cFF2959D3|Hspell:423539|h[心灵之火]|h|r影响时会造成更高的神圣伤害。\n$bullet;|cFF2959D3|Hspell:423588|h[圣光屏障]|h|r存在时，隐修院长穆普雷会造成不断提高的神圣伤害。', 56647),
(27928, 'zhCN', '伤害输出者', '$bullet;|cFF2959D3|Hspell:423588|h[圣光屏障]|h|r存在时，隐修院长穆普雷会造成不断提高的神圣伤害。\n$bullet;阿拉希虔信者受到|cFF2959D3|Hspell:425022|h[非凡力量]|h|r影响时会对附近的玩家造成神圣伤害。', 56647),
(27849, 'zhCN', '治疗者', '$bullet;驱散|cFF2959D3|Hspell:424889|h[震地回响]|h|r可以施加能够降低大量伤害的|cFF2959D3|Hspell:424893|h[石盾]|h|r。\n$bullet;快速连续摧毁多个|cFF2959D3|Hspell:424903|h[不稳定尖刺]|h|r会造成大量伤害。\n$bullet;E.D.N.A.的|cFF2959D3|Hspell:424805|h[折光射线]|h|r会引爆任何被击中的|cFF2959D3|Hspell:424903|h[不稳定尖刺]|h|r。', 56647),
(27761, 'zhCN', '治疗者', '$bullet;|cFF2959D3|Hspell:422969|h[报偿之怒]|h|r期间男爵造成的伤害会大幅提高。\n$bullet;|cFF2959D3|Hspell:423015|h[谴罚者之盾]|h|r会在每个被击中的玩家的位置留下|cFF2959D3|Hspell:423019|h[谴罚者爆破]|h|r。', 56647),
(27760, 'zhCN', '伤害输出者', '$bullet; |cFF2959D3|Hspell:423051|h[灼烧之光]|h|r如果不被打断，就会治疗布朗派克并对周围目标造成伤害。\n$bullet; |cFF2959D3|Hspell:423015|h[谴罚者之盾]|h|r会在每个被击中的玩家的位置留下|cFF2959D3|Hspell:423019|h[谴罚者爆破]|h|r。', 56647),
(30031, 'zhCN', '第50部分', '$[!17\n\n在随机团队难度下，|cFF2959D3|Hspell:438708|h[针刺虫群]|h|r被驱散时，只会转移到塔卡兹基处。$]', 56647),
(28206, 'zhCN', '第8部分', '$[!23, 8\n\n在史诗难度下，虚空裂隙吞噬|cFF2959D3|Hspell:427329|h[虚空腐蚀]|h|r后会移动到新的位置。$]', 56647),
(27846, 'zhCN', '综述', '土灵防御与灭除自动体会周期性地使用|cFF2959D3|Hspell:424805|h[折光射线]|h|r瞄准玩家，对被击中的玩家造成伤害，并摧毁路径上的|cFF2959D3|Hspell:424903|h[不稳定尖刺]|h|r。\n$[!23, 8\n\n能量达到100点时， E.D.N.A.会释放|cFF2959D3|Hspell:424879|h[大地破裂]|h|r，摧毁所有|cFF2959D3|Hspell:424903|h[不稳定尖刺]|h|r。$]', 56647),
(29585, 'zhCN', '第15部分', '$[!8,23\n\n在史诗难度下，这些碎片会形成|cFF2959D3|Hspell:435813|h[不稳定能量]|h|r的微粒。$]', 56647),
(28727, 'zhCN', '第18部分', '', 56647),
(28719, 'zhCN', '第13部分', '', 56647),
(30355, 'zhCN', '虚空碎块', '释放腐蚀和风暴复仇会令畸体的碎块散落场内。碎块会在$428269D内重塑形体，转变为觉醒的虚空石。', 56647),
(30018, 'zhCN', '伤害输出者', '$bullet; |cFF2959D3|Hspell:439502|h[追踪者缠网]|h|r会使触及的玩家定身。\n$bullet;贪婪之裔会持续对一名玩家施加|cFF2959D3|Hspell:439037|h[开膛破肚]|h|r。', 56647),
(30004, 'zhCN', '坦克', '$bullet;|cFF2959D3|Hspell:436799|h[液化]|h|r的玩家无力抵抗 |cFF2959D3|Hspell:437093|h[盛宴]|h|r。\n$bullet;|cFF2959D3|Hspell:443325|h[感染]|h|r效果结束时会对大范围内的盟友造成高额伤害。\n$bullet;|cFF2959D3|Hspell:443336|h[啃噬]|h|r每一击都会造成越来越高的伤害。\n$bullet;|cFF2959D3|Hspell:437417|h[剧毒新星]|h|r会使触及的|cFF2959D3|Hspell:438846|h[活性飞沫]|h|r无法使用。', 56647),
(30001, 'zhCN', '坦克', '$bullet;|cFF2959D3|Hspell:436799|h[液化]|h|r的玩家无力抵抗 |cFF2959D3|Hspell:437093|h[盛宴]|h|r。\n$bullet;|cFF2959D3|Hspell:437093|h[盛宴]|h|r会吸收高额治疗量。\n$bullet;|cFF2959D3|Hspell:443325|h[感染]|h|r会创造幽暗幼体，触及安苏雷克时会造成致命伤害。\n$bullet;|cFF2959D3|Hspell:443336|h[啃噬]|h|r每一击都会造成越来越高的伤害。', 56647),
(22904, 'zhCN', '综述', '耐奥祖的残迹会周期性地召唤折磨宝珠，宝珠会对所有玩家造成伤害，直到宝珠被消灭并被扔出平台。\n在剩余生命值为80%、60%和30%时，包裹耐奥祖的残迹的一片护甲会碎裂，使|cFF2959D3|Hspell:350671|h[怨恨光环]|h|r获得强化。', 56647),
(8166, 'zhCN', '幽灵猛击', '雪怒猛击$144638A1码锥形范围内的玩家，造成$144638s1点物理伤害，并使其护甲值降低$444333s1%，持续$444333d。', 56647),
(30000, 'zhCN', '坦克', '$bullet;|cFF2959D3|Hspell:436799|h[液化]|h|r的玩家无力抵抗 |cFF2959D3|Hspell:437093|h[盛宴]|h|r。\n$bullet;|cFF2959D3|Hspell:437093|h[盛宴]|h|r会吸收高额治疗量。\n$bullet;|cFF2959D3|Hspell:443325|h[感染]|h|r会创造幽暗幼体，触及安苏雷克时会造成致命伤害。\n$bullet;|cFF2959D3|Hspell:443336|h[啃噬]|h|r会对所有玩家造成多次爆发伤害，需要减伤应对。', 56647),
(29998, 'zhCN', '伤害输出者', '$bullet;若虔诚的敬奉者未被击败，则会施放|cFF2959D3|Hspell:448458|h[寰宇天启]|h|r。\n$bullet;|cFF2959D3|Hspell:445422|h[吐沫的饕餮者]|h|r吸收|cFF2959D3|Hspell:444829|h[女王的应诏者]|h|r时会产生|cFF2959D3|Hspell:445877|h[泛沫蒸汽]|h|r。\n$bullet;|cFF2959D3|Hspell:437417|h[剧毒新星]|h|r会造成严重伤害，但可以通过|cFF2959D3|Hspell:438846|h[活性飞沫]|h|r避免。\n$bullet;|cFF2959D3|Hspell:445422|h[吐沫的饕餮者]|h|r会造成高额伤害，但可以通过|cFF2959D3|Hspell:443915|h[虚空导能器]|h|r避免。', 56647),
(29997, 'zhCN', '综述', '$[14,17战斗开始时，安苏雷克喷射|cFF2959D3|Hspell:438846|h[活性飞沫]|h|r，随后施放|cFF2959D3|Hspell:437417|h[剧毒新星]|h|r。最后，安苏雷克会尝试|cFF2959D3|Hspell:447076|h[掠食]|h|r虚弱的敌人并将其吞噬。\n\n玩家打破蛛网护盾后，安苏雷克会升入私人殿堂并呼唤援军。安苏雷克从远处攻击玩家时，援军会准备施放|cFF2959D3|Hspell:448458|h[寰宇天启]|h|r。\n\n当玩家闯入私人殿堂后，安苏雷克会停止施放|cFF2959D3|Hspell:449940|h[酸蚀天启]|h|r，并开始|cFF2959D3|Hspell:449986|h[溟光沟通]|h|r。凭借升华的宇宙之力，安苏雷克企图用|cFF2959D3|Hspell:445422|h[吐沫的饕餮者]|h|r吞噬|cFF2959D3|Hspell:444829|h[女王的应诏者]|h|r。$]$[15,16战斗开始时，安苏雷克喷射|cFF2959D3|Hspell:438846|h[活性飞沫]|h|r，随后施放|cFF2959D3|Hspell:437417|h[剧毒新星]|h|r。最后，安苏雷克会尝试|cFF2959D3|Hspell:447076|h[掠食]|h|r虚弱的敌人并将其吞噬。\n\n玩家打破蛛网护盾后，安苏雷克会升入私人殿堂并呼唤援军。安苏雷克从远处攻击玩家时，援军会准备施放|cFF2959D3|Hspell:448458|h[寰宇天启]|h|r。\n\n当玩家闯入私人殿堂后，安苏雷克会停止施放|cFF2959D3|Hspell:449940|h[酸蚀天启]|h|r，并开始|cFF2959D3|Hspell:449986|h[溟光沟通]|h|r。凭借升华的宇宙之力，安苏雷克企图用|cFF2959D3|Hspell:445422|h[吐沫的饕餮者]|h|r吞噬|cFF2959D3|Hspell:445152|h[侍僧精华]|h|r。$]', 56647),
(29707, 'zhCN', '虚空碎块', '风暴复仇会令畸体的碎块散落场内。碎块会在$428269D内重塑形体，转变为觉醒的虚空石。', 56647),
(28834, 'zhCN', '伤害输出者', '$bullet; 触及|cFF2959D3|Hspell:439502|h[追踪者缠网]|h|r会将玩家和附近的盟友困入|cFF2959D3|Hspell:455831|h[硬化缠网]|h|r。\n$bullet;贪婪之裔会持续对一名玩家施加|cFF2959D3|Hspell:439037|h[开膛破肚]|h|r。', 56647),
(27369, 'zhCN', '治疗者', '$bullet;没有|cFF2959D3|Hspell:426866|h[烛光]|h|r的玩家会受到来自|cFF2959D3|Hspell:422806|h[扼息暗影]的衰弱效果|h|r。\n$bullet;|cFF2959D3|Hspell:427100|h[幽影斩击]|h|r和|cFF2959D3|Hspell:427011|h[暗影冲击]|h|r都会在攻击时破坏光源。', 56647),
(27367, 'zhCN', '坦克', '$bullet;没有|cFF2959D3|Hspell:426866|h[烛光]|h|r的玩家会受到来自|cFF2959D3|Hspell:422806|h[扼息暗影]的衰弱效果|h|r。\n$bullet;|cFF2959D3|Hspell:427100|h[幽影斩击]|h|r和|cFF2959D3|Hspell:427011|h[暗影冲击]|h|r都会在攻击时破坏光源。', 56647);
INSERT INTO `journal_instance_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(1271, 'zhCN', '艾拉-卡拉，回响之城', '艾拉-卡拉，回响之城就在千丝之城的下方，是后者被遗弃的底层废墟。安苏雷克的部队正在那里收割危险的材料，试图在必要的时候让所有蛛魔扬升——无论他们情愿与否。', 56647),
(1278, 'zhCN', '卡兹阿加', '卡兹阿加的地底最近动乱不断。不单心核隧途坍塌，蛛魔咄咄逼人，其他威胁也日益凸显。考尔达克，休眠的保护者为了保护多恩岛而苏醒。在喧鸣深窟，惊魂聚合体等待着值得一战的对手。陨圣峪的水域受到了修拉伊，地渊之海的暴虐者的惊扰。在艾基-卡赫特的深渊中，渊行者欧尔塔，破碎山峦已被黑血所扭曲。', 56647);
INSERT INTO `keystone_affix_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(9, 'zhCN', '残暴', '首领的生命值提高25%，首领及其爪牙造成的伤害最多提高15%。', 56647),
(145, 'zhCN', '鲁莽', '无法力值的非首领敌人的攻击无视20%的护甲值，但其护甲值降低30%，而且受到的奥术伤害提高10%。', 56647),
(144, 'zhCN', '荆棘', '无法力值的非首领敌人被攻击时会对攻击者造成物理伤害，但受到的神圣和暗影伤害提高10%。', 56647),
(133, 'zhCN', '专注', '有法力值的非首领敌人的急速提高30%，但受到的冰霜和火焰伤害提高10%。', 56647);
