INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(776, 'zhCN', '迅捷幽灵双头飞龙', '|cFFFFD200绝版|r', '就算是亡灵，偶尔也需要飞行。', 56647),
(2188, 'zhCN', '卡赫，深渊传奇', '|cFFFFD200成就：|r钓鱼猛冲大赛|n|cFFFFD200分类：|r钓鱼', '', 56647),
(2218, 'zhCN', '炉铸角斗士的魔蝠', '|cFFFFD200成就|r角斗士：“地心之战”第1赛季|n|cFFFFD200分类：|rPvP', '从战场的洞穴中苏醒，全副武装地投入战斗。', 56647),
(2159, 'zhCN', '主机防御单位1-11', '|cFFFFD200宝藏：|r觉醒宝匣|n|cFFFFD200地区：|r喧鸣深窟', '为守卫主机而设计的众多机甲之一。经过多年的忠诚服务，它已不再适合战斗。但它依然是一种引人瞩目的交通工具。', 56647),
(2209, 'zhCN', '赤红泥鼻鼹', '|cFFFFD200商人出售：|r蜡贩斯奎克|n|cFFFFD200地区：|r喧鸣深窟|n|cFFFFD200价格：|r8125|Hcurrency:2815|h|TInterface\\ICONS\\SPELL_AZERITE_ESSENCE14.BLP:0|t|h', '泥鼻鼹经常被狗头人当成坐骑，邃渊协盟已经批准向你出让他们最忠诚的一只泥鼻鼹。', 56647);
