(128259, 'zhCN', '', '', '- 分解史诗装备时，+$ev1技能。|n|n- 你的分解配方已经过充分调和，使你在分解史诗装备时萃取出卡兹阿加原生魔法精华的几率提升。', 56647),
(128092, 'zhCN', '', '', '- 制作雕制类装备时，解锁公函栏位。|n|n- 解锁你选择的一个副专精。 ', 56647),
(128084, 'zhCN', '', '', '- 制作武器时，解锁注入能量栏位。|n|n- 解锁你选择的一个副专精。', 56647),
(128076, 'zhCN', '', '', '- 制作法杖时，解锁成品材料栏位。|n|n- 制作法杖时，+$ev1 $en1。', 56647),
(128070, 'zhCN', '', '', '- 制作法杖时，+$ev1 $en1。|n|n- 制作法杖时，+$ev2 $en2。', 56647),
(128068, 'zhCN', '', '', '- 制作弓时，解锁成品材料栏位。|n|n- 制作弓时，+$ev1 $en1。', 56647),
(128062, 'zhCN', '', '', '- 制作弓时，+$ev1 $en1。|n|n- 制作弓时，+$ev2 $en2。', 56647),
(128060, 'zhCN', '', '', '- 制作法典时，解锁成品材料栏位。|n|n- 制作法典时，+$ev1 $en1。', 56647),
(128054, 'zhCN', '', '', '- 制作法典时，+$ev1 $en1。|n|n- 制作法典时，+$ev2 $en2。', 56647),
(128044, 'zhCN', '', '', '- 制作铭文专业装备时，解锁成品材料栏位。|n|n- 制作铭文专业装备时，+$ev1 $en1。', 56647),
(128041, 'zhCN', '', '', '- 制作铭文专业装备时，+$ev1 $en1。|n|n- 制作铭文专业装备时，+$ev2 $en2。', 56647),
(128038, 'zhCN', '', '', '- 制作铭文专业装备时，+$ev1 $en1。|n|n- 制作铭文专业装备时，+$ev2 $en2。', 56647),
(128036, 'zhCN', '', '', '- 制作炼金专业装备时，解锁成品材料栏位。|n|n- 制作炼金专业装备时，+$ev1 $en1。', 56647),
(128033, 'zhCN', '', '', '- 制作炼金专业装备时，+$ev1 $en1。|n|n- 制作炼金专业装备时，+$ev2 $en2。', 56647),
(128030, 'zhCN', '', '', '- 制作炼金专业装备时，+$ev1 $en1。|n|n- 制作炼金专业装备时，+$ev2 $en2。', 56647),
(128028, 'zhCN', '', '', '- 制作烹饪专业装备时，解锁成品材料栏位。|n|n- 制作烹饪专业装备时，+$ev1 $en1。', 56647),
(128025, 'zhCN', '', '', '- 制作烹饪专业装备时，+$ev1 $en1。|n|n- 制作烹饪专业装备时，+$ev2 $en2。', 56647),
(128022, 'zhCN', '', '', '- 制作烹饪专业装备时，+$ev1 $en1。|n|n- 制作烹饪专业装备时，+$ev2 $en2。', 56647),
(127980, 'zhCN', '', '', '- 制作合约时，+$ev1 $en1。|n|n制作合约时，+$ev2 $en2。', 56647),
(127972, 'zhCN', '', '', '- 制作公函时，+$ev1 $en1。|n|n制作公函时，+$ev2 $en2。', 56647),
(124157, 'zhCN', '', '', '学习如何$@spellname423395，使你能够向强化草药中灌输能量，获取独特的加成和效果。另外，每当你在卡兹阿加采集草药，都会缩短该技能的冷却时间。', 56647),
(124096, 'zhCN', '', '', '学习如何在骑乘时采集卡兹阿加的草药。', 56647),
(124095, 'zhCN', '栽培', '', '研究在卡兹阿加培育植物的深奥秘辛。每有一点此专精，在采集草药时获得+$ev1 $en1。', 56647),
(24910, 'zhCN', '', '', '学习制作龙巢之盐，这是一种成品材料，可以提高奇思。|n|n制作材料和熏香时，+$ev1%$en1。', 56647);
INSERT INTO `trait_sub_tree_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(32, 'zhCN', '天启骑士', '天启骑士能够召唤传说中的天启四骑士的力量，呼唤各位骑士助战，将死亡、饥荒和疫病之力操持自如。', 56647),
(64, 'zhCN', '天神御师', '天神御师献身于至尊天神的教导，拥抱他们的智慧并驾驭他们的力量。天神御师还可以在短时间内同时引导所有天神的力量。', 56647),
(39, 'zhCN', '日怒', '日怒投身于奥术烈焰，增强了最具破坏性的魔咒，甚至可以呼唤法术火焰凤凰助阵。', 56647),
(57, 'zhCN', '灵魂收割者', '很少有人能掌握灵魂之力，但许多人都知道，形形色色的恶魔都对堕落的灵魂垂涎欲滴。灵魂收割者与扭曲虚空的恶魔签订了契约，成为他们的主人，用宿敌的灵魂换取不可思议的力量。', 56647),
(59, 'zhCN', '恶魔使徒', '燃烧军团被击败之后，许多强大的恶魔也摆脱了约束。恶魔使徒曾驱使过被认为是无法控制的强大恶魔，在战场上运用着来自扭曲虚空的深渊之力。', 56647);
