(73, 'zhCN', '第1赛季全新内容！', '第1赛季开始', '在史诗地下城和新评级战场闪电战中赢得奖励！', '尼鲁巴尔王宫', '在艾基-卡赫特突袭安苏雷克女王的权力王座。', '泽克维尔的巢穴', '完成新赛季地下堡内容，解锁泽克维尔的巢穴。', 56647);
